import React from "react";
import Footer from "react-bootstrap/Navbar";
import {Container, Row, Col, Card, Image, NavDropdown, Nav} from "react-bootstrap";
import Facebook from "./facebook.png";
import LinkedIn from "./linkedIn.jpg";
// import Nav from "react-bootstrap/Nav";
// import axios from "axios";
import "./footer.css";

const Foot = () => {
  return (
      
        <Footer>
            <h4> &copy; 2019 || Nyleesia Nicome Schnarr.</h4>
            <br/>
            <p>
            <br/> All rights reserved. 
            </p>

        <Container>
          <Row>
            <Col>        
              <Image src = {Facebook}fluid> 
              </Image> 
            </Col>      
            <Col>        
              <Image src = {LinkedIn}fluid> 
              </Image> 
            </Col> 
            </Row>
            </Container>


            <Nav className="mr-auto">

          <Nav.Link href="">Education</Nav.Link>
          <Nav.Link href="">Work Experience</Nav.Link>
          <NavDropdown title="Projects" id="basic-nav-dropdown" href="">
          <Nav.Link href="">Individual</Nav.Link>
          <Nav.Link href="">Group</Nav.Link></NavDropdown>
          
          <NavDropdown title="Projects" id="basic-nav-dropdown" href="">
          <Nav.Link href="">My Card</Nav.Link>
          <Nav.Link href="">Message Me</Nav.Link></NavDropdown>

      </Nav> 
          </Footer>
      )
}
    
export default Foot;
